import React, { Component } from "react";
import ContactsArray from "../contacts.json";

import "./FilterNav.css";

class ArticlesTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      men: false,
      women: false
    };
  }

  OnlyMen() {
    this.setState({
      men: true,
      women: false
    });
  }

  OnlyWomen() {
    this.setState({
      men: false,
      women: true
    });
  }

  render() {
    return (
      <div className="filter-nav">
        <form>
          <label>
            <input type="checkbox" onClick={() => this.sortName()} />
            Filter 1
          </label>
          <label>
            <input type="checkbox" onClick={() => this.sortName()} />
            Filter 2
          </label>
          <label>
            <input type="checkbox" onClick={() => this.sortName()} />
            Filter 3
          </label>
        </form>
      </div>
    );
  }
}

export default ArticlesTable;
